import React, { useState } from 'react';

import "./navbar.css"; 

import { Link } from "react-router-dom";

const Navbar = () => {

    const [searchValue, setSearchValue] = useState("");

    return (
        <nav>
            <div>
                <Link to="/">
                    <span className="material-symbols-outlined home">home</span>
                </Link>
                <input type="text" className="search" placeholder='search...' value={searchValue} onChange=''></input>
                <button><span className="material-symbols-outlined lens">search</span></button>
            </div>
            <div>
                <Link to="/log-in">Log In</Link>
                <Link to="/sign-up">Sign Up</Link>
            </div>
        </nav>
    )
}

export default Navbar;
